import React from 'react'
import './Profile.css'
import profileImg from '../assets/img/profileImages/308005691_464884012340731_7728597009113021700_n.jpg'


function Profile(){
    return(<>
        <img className='portada' width='100%' src='https://concepto.de/wp-content/uploads/2014/08/programacion-2-e1551291144973.jpg'></img>
        <img className='profile' src={profileImg}></img>
    </>)
}

export {Profile}
